import React from "react";
import "./App.css";
import Navbar from "./components/Navbar";
import Services from "./components/services/Services";
import Projects from "./components/projects/Projects";
import Timeline from "./components/timeline/Timeline";
import Team from "./components/team/Team";
import Partners from "./components/partners/Partners";
import Footer from "./components/footer/Footer";
import HeaderNavs from "./components/headerNavs/HeaderNavs";
import NavbarToggle from "./components/navbarWithToggle/NavbarToggle";
import MainBack from "./components/mainBackground/Mainback";
import CardMain from "./components/team/CardMain";
import ScrollspyNav from "react-scrollspy-nav";

const App = () => {
  return (
    <div className="App">
      <ScrollspyNav
        scrollTargetIds={["section_1", "section_2", "section_3"]}
        offset={100}
        activeNavClass="is-active"
        scrollDuration="1000"
        headerBackground="true"
      ></ScrollspyNav>
      <HeaderNavs />
      <Navbar />
      <NavbarToggle />
      <MainBack />
      <Services />
      <Projects />
      <Timeline />
      <Team />
      <Partners />
      <Footer />
    </div>
  );
};

export default App;
